import React from 'react';
import { NavLink } from 'react-router-dom';
import './style.css';

class Logo extends React.Component {

    render() {
        return (
            <NavLink to='/'>
                <div className="ui items">
                    <div className="item" style={{padding: "0x 0px 0px 0px"}}>
                        <div className="middle aligned content" style={{padding: "10px 0px 0px 3px"}}>
                            <p className="ogo-title">Johnny Li</p>
                        </div>
                    </div>
                </div>
            </NavLink>
        );
    }
}

export default Logo;
